// src/App.js
import React from 'react';
import Sidebar from './components/Sidebar';
import Dashboard from './components/Dashboard';
import { Container, Row, Col } from 'react-bootstrap';
import './App.css';

function App() {
  return (
    <Container fluid>
      <Row>
        <Col md={2}>
          <Sidebar />
        </Col>
        <Col md={10}>
          <Dashboard />
        </Col>
      </Row>
    </Container>
  );
}

export default App;
